package bean;

public class hangbean {
	private String mahang;
	private String tenhang;
	private Long soluong;
	private Long gia;
	private String anh;
	private String maloai;
	private String mota;
	private String thanhphan;
	private String hdsd;
	private String congdung;
	private String dungtich;
	public hangbean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public hangbean(String mahang, String tenhang, Long soluong, Long gia, String anh, String maloai, String mota,
			String thanhphan, String hdsd, String congdung, String dungtich) {
		super();
		this.mahang = mahang;
		this.tenhang = tenhang;
		this.soluong = soluong;
		this.gia = gia;
		this.anh = anh;
		this.maloai = maloai;
		this.mota = mota;
		this.thanhphan = thanhphan;
		this.hdsd = hdsd;
		this.congdung = congdung;
		this.dungtich = dungtich;
	}
	public String getMahang() {
		return mahang;
	}
	public void setMahang(String mahang) {
		this.mahang = mahang;
	}
	public String getTenhang() {
		return tenhang;
	}
	public void setTenhang(String tenhang) {
		this.tenhang = tenhang;
	}
	public Long getSoluong() {
		return soluong;
	}
	public void setSoluong(Long soluong) {
		this.soluong = soluong;
	}
	public Long getGia() {
		return gia;
	}
	public void setGia(Long gia) {
		this.gia = gia;
	}
	public String getAnh() {
		return anh;
	}
	public void setAnh(String anh) {
		this.anh = anh;
	}
	public String getMaloai() {
		return maloai;
	}
	public void setMaloai(String maloai) {
		this.maloai = maloai;
	}
	public String getMota() {
		return mota;
	}
	public void setMota(String mota) {
		this.mota = mota;
	}
	public String getThanhphan() {
		return thanhphan;
	}
	public void setThanhphan(String thanhphan) {
		this.thanhphan = thanhphan;
	}
	public String getHdsd() {
		return hdsd;
	}
	public void setHdsd(String hdsd) {
		this.hdsd = hdsd;
	}
	public String getCongdung() {
		return congdung;
	}
	public void setCongdung(String congdung) {
		this.congdung = congdung;
	}
	public String getDungtich() {
		return dungtich;
	}
	public void setDungtich(String dungtich) {
		this.dungtich = dungtich;
	}
	
	
}
